import React from 'react';

const Card=({name ,email,id})=>{
    return (
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='first_image' src={`https://robohash.org/${id}?20x20`}  width='300' height='300'/>
            <div>
                <h2>{name}</h2>
                <p>{email}</p>
            </div>
        </div>
     );
}

export default Card;
